[{"operationName":"DegreeHomeAppQuery","variables":{"slug":"master-of-computer-science-asu"},"query":"query DegreeHomeAppQuery($slug: String!) {
  DegreesV1Resource {
    degrees: bySlug(slug: $slug) {
      elements {
        id
        __typename
      }
      __typename
    }
    __typename
  }
}
"}]
